(7, 4, 'ru', '/uploads/banner-main/img-1.jpg', 'Отдушки и парфюмерные композиции', 'Запах является визитной карточкой любого продукта, первым впечатлением, ароматной памятью, которая надолго сохраняется в воспоминании. Выбор ароматической композиции, отдушки, имеет крайне важное значение при составлении рецептуры.', NULL, 'Каталог', 1, '2021-02-23 10:38:24', '2021-02-23 10:38:24'),
(8, 4, 'ua', '/uploads/banner-main/img-1.jpg', 'Аромати і парфумерні композиції', 'Запах є візитною карткою будь-якого продукту, першим враженням, ароматної пам\'яттю, яка надовго зберігається в спогаді. Вибір ароматичної композиції, аромати, має вкрай важливе значення при складанні рецептури.', NULL, 'Каталог', 1, '2021-02-23 10:38:24', '2021-02-23 10:38:24'),
