(23, 12, 'ru', '/uploads/about-company-main/1.jpg', NULL, '<p>Предприятие ООО &laquo;РосКосметика&raquo; было основано в 2001 году. Являясь ведущим украинским разработчиком и производителем отдушек, наше предприятие отлично осведомлено во всех областях практических знаний, необходимых для создания и продвижения новых продуктов, а также возможностями для обеспечения наших клиентов превосходным сервисом и продукцией наивысшего качества. На сегодняшний день, предприятие производит отдушки для всех областей промышленности: отдушки для косметики, отдушки для бытовой химии, отдушки для критичных pH и отдушки для маскировки запаха изопропилового спирта и т.п.</p>', 'about-company', 'Подробнее', 1, '2021-02-23 11:13:17', '2021-03-01 16:18:35'),
(24, 12, 'ua', '/uploads/about-company-main/1.jpg', NULL, '<p>Підприємство ТОВ &laquo;РосКосметика&raquo; було засновано в 2001 році. Будучи провідним українським розробником і виробником ароматів, наше підприємство відмінно поінформоване у всіх областях практичних знань, необхідних для створення та просування нових продуктів, а також можливостями для забезпечення наших клієнтів чудовим сервісом і продукцією найвищої якості. На сьогоднішній день, підприємство виробляє аромати для всіх галузей промисловості: аромати для косметики, аромати для побутової хімії, аромати для критичних pH і аромату для маскування запаху ізопропілового спирту і т.п.</p>', 'about-company', 'Детальніше', 1, '2021-02-23 11:13:17', '2021-03-01 16:18:35'),
(25, 13, 'ru', '/uploads/catalog-main/04.jpg', 'Услуги хроматосмасс GSMS', NULL, NULL, 'Услуги хроматосмасс GSMS', 1, '2021-03-01 11:06:24', '2021-03-01 11:06:24'),
(26, 13, 'ua', '/uploads/catalog-main/04.jpg', 'Услуги хроматосмасс GSMS', NULL, NULL, 'Услуги хроматосмасс GSMS', 1, '2021-03-01 11:06:24', '2021-03-01 11:06:24'),
