(6, 4, 'ru', 'Косметические отдушки: что это такое и зачем они нужны', 'kosmeticheskie-otdushki-chto-eto-takoe-i-zachem-oni-nuzhni', 'Косметические отдушки – особая группа ароматических веществ разного происхождения, которые придают запах косметическим средствам, подавляют специфический аромат основы некоторых продуктов. В нее входят природные и синтетического происхождения вещества. Ранее для решения рассматриваемых задач применяли именно природные ингредиенты – это эфирные масла, экстракты растений, амбру, мускус. С развитием науки привычная отдушка в косметике получила более широкое значение, появились не токсичные синтетические компоненты. Они представляют собой чистые вещества, полученные чисто химическим путем и имеющие приятный аромат. В косметике сегодня чаще всего применяют смеси натуральных и искусственных компонентов. Это позволяет получать ароматы с заданными характеристиками.', '<h2>Области применения</h2>\r\n<section>\r\n<p>Косметическая отдушка для подавления резкого, специфического аромата основы применяется в таких областях:</p>\r\n<ul class=\"unordered-list\">\r\n<li>парфюмерия;</li>\r\n<li>мыловарение;</li>\r\n<li>приготовление косметических средств.</li>\r\n</ul>\r\n<p>В составе парфюмерной композиции они позволяют корректировать интенсивность определенных ноток, создавать неповторимые ароматы духов, туалетной воды. Мыловар с применением отдушек воплощает в жизнь любые творческие замыслы. В ходе создания шампуней, гелей для душа, кремов, тоников, пен для ванн вкусовые ароматизаторы и отдушки тоже незаменимы.</p>\r\n<p>С учетом назначения косметических средств, желаемого эффекта производитель добавляет разное количество отдушек. Для сравнения &ndash; в креме их стандартно около 1%, геле для душа не более &ndash; 0.5%, в освежителе воздуха до 20%. Многое зависит от политики работы конкретного бренда &ndash; есть экомарки, минимизирующие содержание отдушек, красителей и других искусственных добавок, есть те, которые применяют их по максимуму.</p>\r\n</section>\r\n<section>\r\n<h2>Что учитывать при выборе</h2>\r\n<p>Выбирая косметическую отдушку, нужно смотреть на такие моменты:</p>\r\n<ul class=\"unordered-list\">\r\n<li>чистота, стойкость аромата;</li>\r\n<li>качество;</li>\r\n<li>экологичность;</li>\r\n<li>гипоаллергенность;</li>\r\n<li>удобство в применении;</li>\r\n<li>личное восприятие.</li>\r\n</ul>\r\n</section>\r\n<section>\r\n<h3>Вывод:</h3>\r\n<p>У каждого запаха свое настроение &ndash; один пробуждает, другой дает энергию, третий создает ореол таинственности, четвертый успокаивает. Интенсивность будет зависеть от количества добавок.</p>\r\n<p>В целом отдушки безопасны, но у людей, склонных к аллергическим реакциям, индивидуальную непереносимость они вызывают нередко. Поэтому нужен баланс между красотой, запахом и его стойкостью, безопасностью.</p>\r\n</section>', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2021-02-25 07:56:45', '2021-02-25 07:56:45'),
(7, 4, 'ua', 'Косметичні віддушки: що це таке і навіщо вони потрібні', 'kosmetichni-viddushki-shho-ce-take-i-navishho-voni-potribni', 'Косметичні віддушки - особлива група ароматичних речовин різного походження, які надають запах косметичних засобів, пригнічують специфічний аромат основи деяких продуктів. У неї входять природні і синтетичного походження речовини. Раніше для вирішення розглянутих завдань застосовували саме природні інгредієнти - це ефірні масла, екстракти рослин, амбру, мускус. З розвитком науки звична віддушка у косметиці отримала більш широке значення, з\'явилися не токсичні синтетичні компоненти. Вони являють собою чисті речовини, отримані чисто хімічним шляхом і мають приємний аромат. У косметиці сьогодні найчастіше застосовують суміші натуральних і штучних компонентів. Це дозволяє отримувати аромати з заданими характеристиками.', '<h2>Області застосування</h2>\r\n<p>Косметична аромат для придушення різкого, специфічного аромату основи застосовується в таких областях:</p>\r\n<ul>\r\n<li>парфумерія;</li>\r\n<li>миловаріння;</li>\r\n<li>приготування косметичних засобів.</li>\r\n</ul>\r\n<p>У складі парфумерної композиції вони дозволяють коригувати інтенсивність певних ноток, створювати неповторні аромати парфумів, туалетної води. Миловар із застосуванням ароматизаторів втілює в життя будь-які творчі задуми. В ході створення шампунів, гелів для душу, кремів, тоніків, пен для ванн смакові ароматизатори і аромату теж незамінні.</p>\r\n<p>З урахуванням призначення косметичних засобів, бажаного ефекту виробник додає різну кількість ароматів. Для порівняння - в кремі їх стандартно близько 1%, гелі для душу не більше - 0.5%, в освіжувачі повітря до 20%. Багато що залежить від політики роботи конкретного бренду - є екомаркі, що мінімізують зміст ароматизаторів, барвників та інших штучних добавок, є ті, які застосовують їх по максимуму.</p>\r\n<h2>Що враховувати при виборі</h2>\r\n<p>Вибираючи косметичну отдушку, потрібно дивитися на такі моменти:</p>\r\n<ul>\r\n<li>чистота, стійкість аромату;</li>\r\n<li>якість;</li>\r\n<li>екологічність;</li>\r\n<li>гипоаллергенность;</li>\r\n<li>зручність в застосуванні;</li>\r\n<li>особисте сприйняття.</li>\r\n<li>висновок:</li>\r\n</ul>\r\n<h2>Висновок:</h2>\r\n<p>У кожного запаху свій настрій - один пробуджує, інший дає енергію, третій створює ореол таємничості, четвертий заспокоює. Інтенсивність буде залежати від кількості добавок.</p>\r\n<p>В цілому аромати безпечні, але у людей, схильних до алергічних реакцій, індивідуальну непереносимість вони викликають нерідко. Тому потрібен баланс між красою, запахом і його стійкістю, безпекою.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2021-02-25 07:56:45', '2021-02-25 07:56:45'),
(8, 5, 'ru', 'В чем отличие отдушки от ароматизатора', 'v-chem-otlichie-otdushki-ot-aromatizatora', 'Рассматривая составляющие компоненты любого продукта, все сталкиваются с названиями «отдушка», либо «ароматизатор». Очевидно, что они оба связаны с ароматами продукта. Но какие же все-таки они имеют отличия?', '<p>Давно выяснено, что при оценке дизайна и композиции читаемый текст мешает сосредоточиться. Lorem Ipsum используют потому, что тот обеспечивает более или менее стандартное заполнение шаблона, а также реальное распределение букв и пробелов в абзацах, которое не получается при простой дубликации \"Здесь ваш текст.. Здесь ваш текст.. Здесь ваш текст..\" Многие программы электронной вёрстки и редакторы HTML используют Lorem Ipsum в качестве текста по умолчанию, так что поиск по ключевым словам \"lorem ipsum\" сразу показывает, как много веб-страниц всё ещё дожидаются своего настоящего рождения. За прошедшие годы текст Lorem Ipsum получил много версий. Некоторые версии появились по ошибке, некоторые - намеренно (например, юмористические варианты).</p>', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2021-02-25 10:31:48', '2021-02-25 10:32:14'),
(9, 5, 'ua', 'У чому відмінність аромати від ароматизатора', 'u-chomu-vidminnist-aromati-vid-aromatizatora', 'Розглядаючи складові компоненти будь-якого продукту, все стикаються з назвами «аромат», або «ароматизатор». Очевидно, що вони обидва пов\'язані з ароматами продукту. Але які ж все-таки вони мають відмінності?', '<p>Давно з\'ясовано, що при оцінці дизайну і композиції читається текст заважає зосередитися. Lorem Ipsum використовують тому, що той забезпечує більш-менш стандартний заповнення шаблону, а також реальний розподіл букв і пробілів в абзацах, яке не виходить за простій дублікації \"Тут ваш текст .. Тут ваш текст .. Тут ваш текст ..\" Багато програм електронної верстки та редактори HTML використовують Lorem Ipsum як текст за замовчуванням, так що пошук за ключовими словами \"lorem ipsum\" відразу показує, як багато веб-сторінок все ще чекають свого справжнього народження. За минулі роки текст Lorem Ipsum отримав багато версій. Деякі версії з\'явилися помилково, деякі - навмисно (наприклад, гумористичні варіанти).</p>', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2021-02-25 10:31:48', '2021-02-25 10:32:14'),
(10, 6, 'ru', 'Где его взять?', 'gde-ego-vzyat', 'Есть много вариантов Lorem Ipsum, но большинство из них имеет не всегда приемлемые модификации, например, юмористические вставки или слова, которые даже отдалённо не напоминают латынь. Если вам нужен Lorem Ipsum для серьёзного проекта, вы наверняка не хотите какой-нибудь шутки, скрытой в середине абзаца. Также все другие известные генераторы Lorem Ipsum используют один и тот же текст, который они просто повторяют, пока не достигнут нужный объём.', '<p>Есть много вариантов Lorem Ipsum, но большинство из них имеет не всегда приемлемые модификации, например, юмористические вставки или слова, которые даже отдалённо не напоминают латынь. Если вам нужен Lorem Ipsum для серьёзного проекта, вы наверняка не хотите какой-нибудь шутки, скрытой в середине абзаца. Также все другие известные генераторы Lorem Ipsum используют один и тот же текст, который они просто повторяют, пока не достигнут нужный объём. Это делает предлагаемый здесь генератор единственным настоящим Lorem Ipsum генератором. Он использует словарь из более чем 200 латинских слов, а также набор моделей предложений. В результате сгенерированный Lorem Ipsum выглядит правдоподобно, не имеет повторяющихся абзацей или \"невозможных\" слов.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2021-02-25 10:35:08', '2021-02-25 10:35:08'),
