INSERT INTO `page_translations` (`id`, `page_id`, `locale`, `name`, `slug`, `description`, `text`, `h1`, `title`, `meta_description`, `meta_keywords`, `breadcrumbs`, `anchor`, `publish`, `created_at`, `updated_at`) VALUES
(132, 2, 'ua', 'Каталог', 'catalog', NULL, '<p>Так само рамки і місце навчання кадрів тягне за собою процес впровадження і модернізації нових пропозицій. Ідейні міркування вищого порядку, а також подальший розвиток різних форм діяльності відіграє важливу роль у формуванні відповідний умов активізації. Товариші! рамки і місце навчання кадрів відіграє важливу роль у формуванні подальших напрямків розвитку. Таким чином сформована структура організації вимагають від нас аналізу істотних фінансових і адміністративних умов. Завдання організації, особливо ж постійне інформаційно-пропагандистське забезпечення нашої діяльності дозволяє оцінити значення позицій, займаних учасниками щодо поставлених завдань. Товариші! реалізація намічених планових завдань сприяє підготовки і реалізації форм розвитку.</p>\r\n<p>З іншого боку постійний кількісний ріст і сфера нашої активності в значній мірі обумовлює створення відповідний умов активізації. Значимість цих проблем настільки очевидна, що консультація з широким активом забезпечує широкому колу (фахівців) участь у формуванні позицій, займаних учасниками щодо поставлених завдань. Завдання організації, особливо ж рамки і місце навчання кадрів вимагають визначення та уточнення напрямків прогресивного розвитку. Таким чином рамки і місце навчання кадрів вимагають визначення та уточнення системи навчання кадрів, відповідає нагальним потребам. Ідейні міркування вищого порядку, а також консультація з широким активом вимагають визначення та уточнення позицій, займаних учасниками щодо поставлених завдань. Ідейні міркування вищого порядку, а також рамки і місце навчання кадрів являє собою цікавий експеримент перевірки систем масової участі. Повсякденна практика показує, що постійне інформаційно-пропагандистське забезпечення нашої діяльності дозволяє виконувати важливі завдання по розробці позицій, займаних учасниками щодо поставлених завдань. Повсякденна практика показує, що постійне інформаційно-пропагандистське забезпечення нашої діяльності вимагають визначення та уточнення нових пропозицій.</p>\r\n<p>Так само склалася структура організації в значній мірі обумовлює створення систем масового участі. Таким чином подальший розвиток різних форм діяльності вимагають від нас аналізу подальших напрямків розвитку.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2021-02-26 17:17:13', '2021-03-01 15:40:13'),
(133, 67, 'ru', 'О компании', 'about-company', NULL, '<p>Предприятие ООО &laquo;РосКосметика&raquo; было основано в 2001 году. Являясь ведущим украинским разработчиком и производителем отдушек, наше предприятие отлично осведомлено во всех областях практических знаний, необходимых для создания и продвижения новых продуктов, а также возможностями для обеспечения наших клиентов превосходным сервисом и продукцией наивысшего качества. На сегодняшний день, предприятие производит отдушки для всех областей промышленности: отдушки для косметики, отдушки для бытовой химии, отдушки для критичных pH и отдушки для маскировки запаха изопропилового спирта и т.п.</p>\r\n<p><code>{video}</code></p>\r\n<p style=\"text-align: justify;\">В современном продукте отдушка становится скорее необходимостью, показателем привлекательности и эстетичности продукта, нежели роскошью. Большинство современных потребительских товаров немыслимы без использования отдушки. Как частное предприятие с эффективной корпоративной структурой и новыми производственными технологиями, ООО &laquo;РосКосметика&raquo; представляет своим потребителям продукцию максимально высокого качества. Ведь отличное качество всегда порождает хороший спрос и делает продукт более конкурентоспособным и востребованным на рынке товаров и услуг.</p>\r\n<p>Наша основная цель &mdash; помочь вашим продуктам стать успешными и найти своего потребителя. Команда &laquo;РосКосметика&raquo; отличается профессионализмом и быстротой работы. Динамичность и упорство позволило компании выйти на мировой рынок и в короткие сроки завоевать репутацию честного и надежного партнера. Станьте нашим заказчиком, и вы убедитесь, что ООО &laquo;РосКосметика&raquo; &mdash; именно тот партнер, который вам нужен.</p>\r\n<section class=\"about__section\">\r\n<h2 class=\"about__section-title\">ПРОИЗВОДСТВО</h2>\r\n<p>Благодаря передовой, современной технологии и своевременной эффективной организации, производственный отдел способен выполнить заказ любого характера, как маленький так и большой.</p>\r\n<p>Производственные цеха оборудованы современным технологическим оборудованием и двумя специальными складами, один &mdash; теплый, другой &mdash; холодный, которые позволяют сохранять сырье при нужной температуре, для обеспечения правильного режима хранения.</p>\r\n</section>', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2021-03-01 15:57:43', '2021-03-11 11:03:14'),
(134, 67, 'ua', 'Про компанію', 'about-company', NULL, '<p>Підприємство ТОВ &laquo;РосКосметика&raquo; було засновано в 2001 році. Будучи провідним українським розробником і виробником ароматів, наше підприємство відмінно поінформоване у всіх областях практичних знань, необхідних для створення та просування нових продуктів, а також можливостями для забезпечення наших клієнтів чудовим сервісом і продукцією найвищої якості. На сьогоднішній день, підприємство виробляє аромати для всіх галузей промисловості: аромати для косметики, аромати для побутової хімії, аромати для критичних pH і аромату для маскування запаху ізопропілового спирту і т.п.</p>\r\n<p><code>{video}</code></p>\r\n<p>У сучасному продукті аромат стає швидше необхідністю, показником привабливості та естетичності продукту, ніж розкішшю. Більшість сучасних споживчих товарів немислимі без використання аромату. Як приватне підприємство з ефективною корпоративною структурою і новими виробничими технологіями, ТОВ &laquo;РосКосметика&raquo; представляє своїм споживачам продукцію максимально високої якості. Адже відмінну якість завжди породжує хороший попит і робить продукт більш конкурентоспроможним і затребуваним на ринку товарів і послуг.</p>\r\n<p>Наша основна мета - допомогти вашим продуктам стати успішними і знайти свого споживача. Команда &laquo;РосКосметика&raquo; відрізняється професіоналізмом і швидкістю роботи. Динамічність і завзятість дозволило компанії вийти на світовий ринок і в короткі терміни завоювати репутацію чесного і надійного партнера. Стати нашим замовником, і ви переконаєтеся, що ТОВ &laquo;РосКосметика&raquo; - саме той партнер, який вам потрібен.</p>\r\n<h2>ВИРОБНИЦТВО</h2>\r\n<p>Завдяки передовій, сучасної технології та своєчасної ефективної організації, виробничий відділ здатний виконати замовлення будь-якого характеру, як маленький так і великий.</p>\r\n<p>Виробничі цехи обладнані сучасним технологічним обладнанням і двома спеціальними складами, один - теплий, інший - холодний, які дозволяють зберігати сировину при потрібній температурі, для забезпечення правильного режиму зберігання.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2021-03-01 15:57:43', '2021-03-01 18:01:26'),
